/* Theme: forestGreen */
@theme reference {
  --color-forestGreen-background: 0 0% 100%;
  --color-forestGreen-foreground: 0 0% 3.9%;
  --color-forestGreen-card: 0 0% 100%;
  --color-forestGreen-card-foreground: 0 0% 3.9%;
  --color-forestGreen-popover: 0 0% 100%;
  --color-forestGreen-popover-foreground: 0 0% 3.9%;
  --color-forestGreen-primary: 142 76% 36%;
  --color-forestGreen-primary-foreground: 0 0% 98%;
  --color-forestGreen-secondary: 138 76% 97%;
  --color-forestGreen-secondary-foreground: 0 0% 9%;
  --color-forestGreen-muted: 210 40% 96%;
  --color-forestGreen-muted-foreground: 0 0% 45.1%;
  --color-forestGreen-accent: 141 79% 85%;
  --color-forestGreen-accent-foreground: 0 0% 9%;
  --color-forestGreen-destructive: 0 72% 51%;
  --color-forestGreen-destructive-foreground: 0 0% 100%;
  --color-forestGreen-border: 214 32% 91%;
  --color-forestGreen-input: 214 32% 91%;
  --color-forestGreen-ring: 142 76% 36%;
}

.theme-forestGreen {
  --color-background: var(--color-forestGreen-background);
  --color-foreground: var(--color-forestGreen-foreground);
  --color-card: var(--color-forestGreen-card);
  --color-card-foreground: var(--color-forestGreen-card-foreground);
  --color-popover: var(--color-forestGreen-popover);
  --color-popover-foreground: var(--color-forestGreen-popover-foreground);
  --color-primary: var(--color-forestGreen-primary);
  --color-primary-foreground: var(--color-forestGreen-primary-foreground);
  --color-secondary: var(--color-forestGreen-secondary);
  --color-secondary-foreground: var(--color-forestGreen-secondary-foreground);
  --color-muted: var(--color-forestGreen-muted);
  --color-muted-foreground: var(--color-forestGreen-muted-foreground);
  --color-accent: var(--color-forestGreen-accent);
  --color-accent-foreground: var(--color-forestGreen-accent-foreground);
  --color-destructive: var(--color-forestGreen-destructive);
  --color-destructive-foreground: var(--color-forestGreen-destructive-foreground);
  --color-border: var(--color-forestGreen-border);
  --color-input: var(--color-forestGreen-input);
  --color-ring: var(--color-forestGreen-ring);
}

@media (prefers-color-scheme: dark) {
  .theme-forestGreen {
    --color-background: 240 10% 3.9%;
    --color-foreground: 0 0% 98%;
    --color-card: 240 10% 3.9%;
    --color-card-foreground: 0 0% 98%;
    --color-popover: 240 10% 3.9%;
    --color-popover-foreground: 0 0% 98%;
    --color-primary: 142 76% 76%;
    --color-primary-foreground: 240 5.9% 10%;
    --color-secondary: 240 3.7% 15.9%;
    --color-secondary-foreground: 0 0% 98%;
    --color-muted: 240 3.7% 15.9%;
    --color-muted-foreground: 240 5% 64.9%;
    --color-accent: 141 79% 25%;
    --color-accent-foreground: 0 0% 98%;
    --color-destructive: 0 62.8% 30.6%;
    --color-destructive-foreground: 0 0% 98%;
    --color-border: 240 3.7% 15.9%;
    --color-input: 240 3.7% 15.9%;
    --color-ring: 142 76% 76%;
  }
}

